Une municipalité est l'administration territoriale d'une entité de type communal qui peut inclure une seule ville ou plusieurs agglomérations (villages, hameaux, lieux-dits, etc). Le terme peut également désigner le territoire sur lequel s'exerce cette administration. L'organisation, les compétences ou la taille du territoire des municipalités varient d'un pays à l'autre. Elles peuvent porter différents noms : 
*  en France, en Belgique ou en Suisse, la municipalité est soit l'ensemble des élus soit l'organe exécutif de la commune ; 
*  on parle également de communes en Allemagne et Autriche (Gemeinde), aux Pays-Bas (gemeente), en Suède (kommuner), etc. 
*  au Canada, on parle généralement de municipalités qui peuvent être des cités (city), villes (town), paroisses (parish), comtés (county), cantons (township), etc. ; au Québec, on distingue municipalités locales et municipalités régionales ; 
*  dans les pays hispanophones, on parle d'ayuntamiento, de municipio ou de comuna ; 
*  dans les pays anglophones, on parle de municipalité (municipality), gouvernement local (local government), zone d'administration locale (Local Government Area), etc. Dans certains pays, l'ensemble du territoire relève d'une municipalité. Dans d'autres, certaines zones généralement peu peuplées ne relèvent d'aucune municipalité.
